I am not sure whether this is caused by a implementation change of model when processing parameter object.

In this report, you have defined a parameter named blocksize, which is given a value of "7|D|1|D". In open script of data set, there are below lines code:

// script begin
token=Packages.java.util.StringTokenizer(params["blocksize"],"|");
vec=new Packages.java.util.Vector();
while(token.hasMoreTokens())
{
vec.addElement(token.nextToken());
}
params["DateRange"]=Packages.java.lang.Integer.parseInt(vec.elementAt(0));
// script end

Since the value of params["blocksize"] is "7|D|1|D", vec.elementAt(0) is "7, and then it can not be parsed to int value. In 1.0.1, the value of params["blocksize"] might be 7|D|1|D, so it can be parsed to int value of 7.

A solution is you remove the double quotation and change to value of "7|D|1|D" to 7|D|1|D.

