The dispose method of the MainTab class looks like this:
/*
 * (non-Javadoc)
 * @see org.eclipse.debug.ui.ILaunchConfigurationTab#dispose()
 */
public void dispose() {
   super.dispose();
   fImage.dispose();
}

Althought super.dispose() is empty I think that as a general rule super.dispose() should be called last in the overriden method or this could cause unpredictable behaviour.

Here's some easy sample code to demonstrate the flicker.

public class Main2 {

    private static Shell shell;

    public static void main (String [] args) {
        Display display = new Display ();
        shell = new Shell (display);
        createContents(shell);

        shell.open ();

        while (!shell.isDisposed()) {
            if (!display.readAndDispatch ()) display.sleep ();
        }
        display.dispose ();
    }

    private static void createContents(Composite parent)
    {        
        final Canvas c = new Canvas(parent,SWT.BORDER | SWT.DOUBLE_BUFFERED);

        c.setBounds(20,20,200,200);

        c.addListener(SWT.MouseMove,new Listener()
        {
            public void handleEvent(Event arg0)
            {
                c.redraw();
            }        
        });
    }
}

There is definitely a flicker bug with the canvas when shows its scrollbars. In the Main2 example code, change the canvas declaration to look like this:

final Canvas c = new Canvas(parent,SWT.BORDER | SWT.DOUBLE_BUFFERED | SWT.V_SCROLL | SWT.H_SCROLL);

Then move the mouse around on it.

build 3.2

In PreferencesOSGiUtils there are a few methods which print out a message to the console (call PreferenceMessages#message) if the service tracker that it is looking to aquire isn't registered. 

public boolean getBooleanDebugOption(String option, boolean defaultValue) {
  if (debugTracker == null) {
    PrefsMessages.message("Debug tracker is not set"); //$NON-NLS-1$
    return defaultValue;
  }
  ...
}

We have similar code in the JobOSGiUtils class but it only prints out if we are in debug mode:

public boolean getBooleanDebugOption(String option, boolean defaultValue) {
  if (debugTracker == null) {
    if (JobManager.DEBUG)
      JobMessages.message("Debug tracker is not set"); //$NON-NLS-1$
    return defaultValue;
  }
  ...
}

Some products which are built on top of Eclipse are very sensitive to having message printed to the console and we should be aware of these sensitivities and behave accordingly.

The instinctive thing to do is to change the prefs code to be the same as the jobs code and only print to the console if we are in debug mode. The question is though, will we ever be in debug mode if the debug tracker is null? Is the code in the jobs bundle correct?

Thoughts?

when calling getClass() on a generic type, Eclipse states that a wildcard bound by the generic type will be returned. For example, the following code compiles in Eclipse 3.1.2 and 3.2:

    private static <T> void testWithGeneric(T input)
    {
        Class<? extends T> clazz = input.getClass();
    }

but javac won't compile this same code. Here's the javac error with java version 1.5.0_06:

    MainClass.java:20: incompatible types
    found   : java.lang.Class<capture of ? extends java.lang.Object>
    required: java.lang.Class<? extends T>
            Class<? extends T> clazz = input.getClass();

See this bug from the sun database:
http://bugs.sun.com/bugdatabase/view_bug.do?bug_id=5004321

According to the above mentioned bug, T must be erased, therefore getClass() should return Class<? extends Object>. javac appears to be correct, whereas Eclipse returns Class<? extends T>

This may be related to bug 120088 and bug 58666.
I tried hard to find an existing bug report on this, assuming that surely someone else has reported it. If this is a dupe, I sincerly apologize.

Complete source code to reproduce:

public class MainClass
{
    public static void main(String[] args)
    {
        String testString = "test string";

        testWithNonGeneric(testString);
        testWithGeneric(testString);
    }

    private static void testWithNonGeneric(String input)
    {
        Class<? extends String> clazz = input.getClass();

        System.out.println(clazz.getName());
    }

    private static <T> void testWithGeneric(T input)
    {
        Class<? extends T> clazz = input.getClass();

        System.out.println(clazz.getName());
    }
}
